import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, useAuth } from './contexts/AuthContext';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

// Layout components
import Navbar from './components/common/Navbar';
import Footer from './components/common/Footer';

// Public pages
import Login from './pages/Login';
import Register from './pages/Register';
import Home from './pages/Home';

// Participant pages
import GameJoin from './pages/participant/GameJoin';
import TaskList from './pages/participant/TaskList';
import TaskSolve from './pages/participant/TaskSolve';
import TeamDashboard from './pages/participant/TeamDashboard';
import Reflection from './pages/participant/Reflection';

// Instructor pages
import GameCreate from './pages/instructor/GameCreate';
import GameManage from './pages/instructor/GameManage';
import TaskCreate from './pages/instructor/TaskCreate';
import SubmissionEvaluate from './pages/instructor/SubmissionEvaluate';
import InstructorDashboard from './pages/instructor/InstructorDashboard';

// Admin pages
import AdminDashboard from './pages/admin/AdminDashboard';
import UserManagement from './pages/admin/UserManagement';
import GameStatistics from './pages/admin/GameStatistics';

// Protected route component
const ProtectedRoute = ({ children, allowedRoles }) => {
  const { isAuthenticated, user, loading } = useAuth();
  
  if (loading) {
    return <div className="flex justify-center items-center h-screen">Loading...</div>;
  }
  
  if (!isAuthenticated) {
    return <Navigate to="/login" />;
  }
  
  if (allowedRoles && !allowedRoles.includes(user.role)) {
    return <Navigate to="/" />;
  }
  
  return children;
};

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="flex flex-col min-h-screen bg-gray-50">
          <Navbar />
          <main className="flex-grow container mx-auto px-4 py-8">
            <Routes>
              {/* Public routes */}
              <Route path="/" element={<Home />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              
              {/* Participant routes */}
              <Route 
                path="/join-game" 
                element={
                  <ProtectedRoute allowedRoles={['participant', 'instructor', 'admin']}>
                    <GameJoin />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/team-dashboard/:teamId" 
                element={
                  <ProtectedRoute allowedRoles={['participant', 'instructor', 'admin']}>
                    <TeamDashboard />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/tasks/:gameId" 
                element={
                  <ProtectedRoute allowedRoles={['participant', 'instructor', 'admin']}>
                    <TaskList />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/solve-task/:taskId" 
                element={
                  <ProtectedRoute allowedRoles={['participant', 'instructor', 'admin']}>
                    <TaskSolve />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/reflection/:gameId" 
                element={
                  <ProtectedRoute allowedRoles={['participant', 'instructor', 'admin']}>
                    <Reflection />
                  </ProtectedRoute>
                } 
              />
              
              {/* Instructor routes */}
              <Route 
                path="/instructor/dashboard" 
                element={
                  <ProtectedRoute allowedRoles={['instructor', 'admin']}>
                    <InstructorDashboard />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/create-game" 
                element={
                  <ProtectedRoute allowedRoles={['instructor', 'admin']}>
                    <GameCreate />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/manage-game/:gameId" 
                element={
                  <ProtectedRoute allowedRoles={['instructor', 'admin']}>
                    <GameManage />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/create-task/:gameId" 
                element={
                  <ProtectedRoute allowedRoles={['instructor', 'admin']}>
                    <TaskCreate />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/evaluate-submission/:submissionId" 
                element={
                  <ProtectedRoute allowedRoles={['instructor', 'admin']}>
                    <SubmissionEvaluate />
                  </ProtectedRoute>
                } 
              />
              
              {/* Admin routes */}
              <Route 
                path="/admin/dashboard" 
                element={
                  <ProtectedRoute allowedRoles={['admin']}>
                    <AdminDashboard />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/admin/users" 
                element={
                  <ProtectedRoute allowedRoles={['admin']}>
                    <UserManagement />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/admin/statistics/:gameId" 
                element={
                  <ProtectedRoute allowedRoles={['admin']}>
                    <GameStatistics />
                  </ProtectedRoute>
                } 
              />
              
              {/* Fallback route */}
              <Route path="*" element={<Navigate to="/" />} />
            </Routes>
          </main>
          <Footer />
        </div>
        <ToastContainer position="bottom-right" />
      </Router>
    </AuthProvider>
  );
}

export default App;
